import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
} from 'react-native'
import Inputfield from '../components/Inputfield'
import React, { useState } from 'react'
import Custombutton from '../components/Custombutton'
import DropDownPicker from 'react-native-dropdown-picker'
import { launchCamera, launchImageLibrary } from 'react-native-image-picker'
import { doc, setDoc,collection } from "firebase/firestore"; 
import { db } from "../firebase/config";



const LeasePage = ({ route }) => {
  const { Props } = route.params
  const [open, setOpen] = useState(false)
  const [items, setItems] = useState([
    { label: 'Electronics', value: 'Electronics' },
    { label: 'Vehicles', value: 'Vehicles' },
    { label: 'Furniture', value: 'Furniture' },
    { label: 'Clothing', value: 'Clothing' },
    { label: 'Books', value: 'Books' },
    { label: 'Real-Estate', value: 'Real-Estate' },
  ])
  const username = Props.userData.username
  const [value, setValue] = useState(null)
  const [ItemtoLease, setItemtoLease] = useState({
    available: true,
    category: null,
    description: '',
    itemname: '',
    owner: username,
    rentedto: [''],
    rentperhour: '',
  })

  const handleCamera = () => {
    const options = {
      storageOptions: {
        path: 'images',
        mediaType: 'photo',
      },
      includeBase64: true,
    }
    try {
      launchCamera(options, (response) => {
        console.log('Response = ', response)
        if (response.didCancel) {
          console.log('User cancelled image picker')
        } else if (response.error) {
          console.log('ImagePicker Error: ', response.error)
        } else if (response.customButton) {
          console.log('User tapped custom button: ', response.customButton)
        } else {
          const source = { uri: response.uri }
          console.log(source)
        }
      })
    } catch (error) {
      console.log(error)
    }
  }
  const validFields = () => {
    if (
        ItemtoLease.itemname === '' ||
        ItemtoLease.description === '' ||
        ItemtoLease.category === null ||
        ItemtoLease.rentperhour === ''
    ) {
        alert('Please fill all the fields')
        return false
    }
    return true
}
  const addNewItem = async () => {
    if (!validFields()) {
        return
    }
    
   
    try {
        const docRef= doc(collection(db, "items"));
        await setDoc(docRef, ItemtoLease);
        console.log("Document written with ID: ", docRef.id);
         alert('Item Added')
    } catch (e) {
        console.error("Error adding document: ", e);
    }
    }


  return (
    <View style={styles.container}>
      <Text style={styles.titleText}>
        Item to <Text style={{ color: '#f87171' }}>Lease</Text>
      </Text>

      <View style={styles.form}>
        <Inputfield
          placeholder="UserName"
          iconname="envelope-o"
          keyboardType="email-address"
          value={username}
        />
        <Inputfield
          placeholder="Item Name"
          iconname="laptop"
          value={ItemtoLease.itemname}
          onChangeText={(text) => {
            setItemtoLease({ ...ItemtoLease, itemname: text })
          }}
        />
        <Inputfield
          placeholder="Price per hour"
          iconname="dollar"
          keyboardType="email-address"
          value={ItemtoLease.rentperhour}
          onChangeText={(text) => {
            setItemtoLease({ ...ItemtoLease, rentperhour: text })
          }}
        />

        <Inputfield
          placeholder="Description"
          iconname="info"
          keyboardType="email-address"
          value={ItemtoLease.description}
          onChangeText={(text) => {
            setItemtoLease({ ...ItemtoLease, description: text })
          }}
        />
        <DropDownPicker
          open={open}
          value={value}
          items={items}
          setOpen={setOpen}
          setValue={setValue}
          setItems={setItems}
          placeholder="Select Category"
          onChangeValue={(value) => {
            setItemtoLease({ ...ItemtoLease, category: value })
          }}
          textStyle={{
            fontSize: 14,
            color: 'grey',
          }}
          containerStyle={{
            marginLeft: 10,
            width: '95%',
          }}
        />

        <TouchableOpacity
          onPress={() => {
            console.log('Camera')
          }}
        >
          <Custombutton title="Upload Image" custombackgroundColor="#24c2ce" />
        </TouchableOpacity>
      </View>

      <TouchableOpacity onPress={addNewItem}>
        <Custombutton title="Submit" custombackgroundColor="#f87171"
        />
      </TouchableOpacity>
    </View>
  )
}

export default LeasePage
const styles = StyleSheet.create({
  container: {
    flex: 1,
    textAlign: 'center',
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#24c2ce',
  },
  form: {
    backgroundColor: 'white',
    borderRadius: 15,
    width: '85%',
    height: '70%',
    padding: 20,
    justifyContent: 'space-evenly',
  },
  titleText: {
    fontSize: 30,
    fontWeight: 'bold',
    textAlign: 'center',
    alignSelf: 'center',
    color: '#ffffff',
    marginBottom: 20,
  },
})
